-- Function to dynamically update snoozes
function updateSnoozeValue(delta)
	local playerObject = Game.getPlayerObject()

	if playerObject ~= nil then
		-- Calculate the address dynamically
		local address = playerObject + 0xE08 + 46

		-- Get the current snoozes value from the textbox
		local currentValue = tonumber(forms.gettext(snooze_textbox)) or 0

		-- Update the snoozes value within the range [0, 255]
		local newValue = currentValue + delta
	
		-- Write the new snoozes value to memory
		mainmemory.write_u8(address, 256 - newValue)

		-- Update the textbox with the new value
		forms.settext(snooze_textbox, tostring(newValue))
	else
		-- Display error in the textbox if playerObject is not found
		forms.settext(snooze_textbox, "Error!")
	end
end

-- Function to continuously read memory and update the snoozes value
function updateSnoozesLive()
	local playerObject = Game.getPlayerObject()

	if playerObject ~= nil then
		-- Calculate the address dynamically
		local address = playerObject + 0xE08 + 46

		-- Read the current snoozes value from memory
		local snoozes = 256 - mainmemory.read_u8(address)

		-- Update the textbox with the current snoozes value
		forms.settext(snooze_textbox, tostring(snoozes))
	else
		-- Display error in the textbox if playerObject is not found
		forms.settext(snooze_textbox, "Player object not found!")
	end
end

-- Continuous update loop
event.onframeend(function()
	updateSnoozesLive()
end)

