function node_prev(addr)
	return mainmemory.read_u32_be(addr-0x80000000+0x0)
end
function node_next(addr)
	return mainmemory.read_u32_be(addr-0x80000000+0x4)
end
function node_isfree(addr)
	if contains(free_blocks, addr) then
		return 1
	else
		return 0
	end
end
function node_blocksize(addr)
	return node_next(addr) - addr - header_size
end
function free_block_prev(addr)
