	obj_array_1_ptr = mainmemory.read_u32_be(0x136EE0)
	obj_array_2_ptr = mainmemory.read_u32_be(0x132DB0)
	music_ptr = mainmemory.read_u32_be(0x12B450)
	
	loaded_assets_list = {}
	x = 0x12B450
	while x < 0x12B650 do
		table.insert(loaded_assets_list, mainmemory.read_u32_be(x))
		x = x + 4
	end
	
	loaded_overlays_list = {}
	x = 0x126738
	while x < 0x1268D8 do
		table.insert(loaded_overlays_list, mainmemory.read_u32_be(x))
		x = x + 4
	end
end

function describe_node(addr)
	desc = ""
	if node_isfree(addr) == 1 then
		desc = "<free>"
	elseif player_ptr == addr+header_size then
		desc = desc.."PLAYER OBJECT";
	elseif text_buffer_ptr == addr+header_size then
		desc = desc.."Text Buffer";
	elseif flag_block_ptr == addr+header_size then
		desc = desc.."Flag Block";
	elseif camera_ptr == addr+header_size then
		desc = desc.."Camera Object";
	elseif obj_array_1_ptr == addr+header_size then
		desc = desc.."OBJECT ARRAY 1";
	elseif obj_array_2_ptr == addr+header_size then
		desc = desc.."OBJECT ARRAY 2";
	elseif music_ptr == addr+header_size then
		desc = "Asset - Music";
	elseif text_script_ptr == addr+header_size then
		desc = desc.."Asset - Text Script";
	elseif contains(loaded_assets_list, addr+header_size) then
		desc = "Asset - unknown";
		
		thebytes = mainmemory.read_bytes_as_array(addr+header_size - 0x80000000, 0x100)
		byte_string = ""
		
		byte_string_length = 0
		for index, value in ipairs(thebytes) do
			byte_string = byte_string..string.lower(string.format("%02X", value))
			byte_string_length = byte_string_length + 1
		end
		--print(byte_string)
		
		for k,v in pairs(assets_3d_models) do 
			--print(v["bytes"])
			if v["size"] == node_blocksize(addr) then
				if v["bytes"] == byte_string then
					desc = "Asset - "..v["name"];
				end
			end 
		end
	elseif contains(loaded_overlays_list, addr+header_size) then
		desc = "Overlay - unknown";
		
		thebytes = mainmemory.read_bytes_as_array(addr+header_size - 0x80000000, 0x100)
		byte_string = ""
		
		for index, value in ipairs(thebytes) do
			if(value > 31) then
				byte_string = byte_string..string.char(value)
			end
		end
		--print(byte_string)
		for index, value in ipairs(overlay_names) do
			if bizstring.contains(byte_string, value) then
				desc = "Overlay - "..value;
				break
			end
		end
	end
	
	return desc
end

function print_node(addr)
	local desc = describe_node(addr)
	local str = string.format("%08X", addr+header_size)..":"..string.format("%06X", node_blocksize(addr)).." "..desc.."\r\n"
	
	if desc == "OBJECT ARRAY 1" and forms.ischecked(show_object_array_checkbox) then
		local firstObjectPtr = mainmemory.read_u32_be(addr+header_size-0x80000000+0x4)
		local lastObjectPtr = mainmemory.read_u32_be(addr+header_size-0x80000000+0x8)
		--print(string.format("%08X", firstObjectPtr).." "..string.format("%08X", lastObjectPtr))
		local x = firstObjectPtr
		while x < lastObjectPtr + 0x9C do
			objectIdPtr = mainmemory.read_u32_be(x - 0x80000000)
			--print(string.format("%08X", objectIdPtr))
			modelId = mainmemory.read_u16_be(objectIdPtr - 0x80000000 + 0x14)
			x_coord = string.format("%.3f", mainmemory.readfloat(x - 0x80000000 + 0x4, true)):gsub(".000", "")
			y_coord = string.format("%.3f", mainmemory.readfloat(x - 0x80000000 + 0x8, true)):gsub(".000", "")
			z_coord = string.format("%.3f", mainmemory.readfloat(x - 0x80000000 + 0xC, true)):gsub(".000", "")
			
			local coords = ""
			if forms.ischecked(show_object_coords_checkbox) then 
				coords = " ("..x_coord..", "..y_coord..", "..z_coord..")"
			end
			if object_models[modelId] ~= nil then
				str = str.."    "..string.format("%08X", x).." "..object_models[modelId]..coords.."\r\n"
			else
				str = str.."    "..string.format("%08X", x).." ".."0x"..modelId..coords.."\r\n"
			end
			x = x + 0x9C
		end
	end
	
	return str
end

function track(node_summary, vars)
	if vars == nil then vars = {} end
	node_tracking[node_summary] = vars
	return nil
end

function trackaddr(addr, val)
	if addr < 0x80000000 then addr = addr + 0x80000000 end
	if val == nil then val = true end
	address_tracking[addr] = val
	return nil
end

function update()
	cursor_pos = forms.getproperty(heap_textbox, "SelectionStart")
	free_blocks = {}
	
	local a = 6
	local node = heap_start
	--[[if forms.ischecked(live_update_checkbox) then
		forms.settext(heap_textbox, "");
	end]]--
	local free_block = heap_start
	--print(string.format("%08X free_block", free_block))
	table.insert(free_blocks, free_block)
	
	while node ~= 0 and free_block_next(node) ~= 0 do
		
		node = free_block_next(node)
		table.insert(free_blocks, node)
		--print(string.format("%08X node", node))
		--print(string.format("%08X node_blocksize(addr)", node_blocksize(node)))
	end
	
	
	node = heap_start
	
	local scale = 1/heapsize*client.screenwidth()/(zoom_end-zoom_begin)
	local offset = zoom_begin / (zoom_end-zoom_begin) * client.screenwidth()
	prev_inputs = inputs
	inputs = input.get()
	
	gui.use_surface("client")
	
	local mouse = input.getmouse()
